import React from 'react';
import Products from '../Products';
import Courses from '../Courses';
import AddCourse from '../Courses/AddCourse';
import AddProduct from '../Products/AddProduct';
const routes = [
	{
		path: '/',
		exact: true,
		component: (props) => {
			return (
				<>
					<Products products={props.productItems} />
					<Courses courses={props.courseItems} />
				</>
			);
		},
	},
	{
		path: '/course',
		component: (props) => <Courses courses={props.courseItems} />,
	},
	{
		path: '/product',
		component: (props) => <Products products={props.productItems} />,
	},
	{
		path: '/course/add',
		exact: true,
		component: (props) => <AddCourse item={props.addCourse} />,
	},
	{
		path: '/product/add',
		component: (props) => <AddProduct item={props.addProduct} />,
	},
];

export default routes;
